Stewardship to this Earth involves farming practices that heal the damage we’ve created to our soil and micro biome. For this reason I’ve been passionate about Regenerative, Biodynamic and Permaculture Farming- to name a few.

@solminerwine shared wisdom to help me in my journey to heal the soil and I’m so grateful. How often are you able to walk onto the very places that make your food, learn about the growing process and leave feeling inspired? This should be the standard. 

Each day I’m closer to having my own farm and I love this community to my core. 🌽🥕🧄
